import React from 'react';
import Button from '../../components/Button';
import { Container, Title } from './styles';

const HomePage = ({ onLogout }) => {
  return (
    <Container>
      <Title>Bem vindo </Title>
      <Button onClick={onLogout}>Logout</Button>
    </Container>
  );
};

export default HomePage;
